exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`https://www.xiaoshuob.com/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/id="readerlist"[^>]*>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};